@narasinewsroom "Jangan kebanyakan makan micin, nanti bikin bego dan sakit kanker,loh." Begitu kira-kira berbagai anggapan yang berkembang di masyarakat kalau lagi ngomongin soal micin. 

Micin atau MSG adalah bumbu penyedap rasa yang tidak asing kamu rasakan saat mengonsumsi bakso, mie ayam, gorengan, ciki-ciki. Karena cita rasanya yang gurih, micin banyak digunakan sebagai penambah rasa pada berbagai masakan.

Tapi, kenapa anggapan kalau micin bikin bego masih berkembangan di masyarakat? Apa benar micin berbahaya buat kesehatan?.

Ini beberapa contoh adek2 SMA yang udah kirim video dan berani tunjukin bakat mereka! 

